export const Navbar = () => {
  return (
    <nav className="navbar">
      <input
        type="search"
        placeholder="Search product..."
        className="search-bar"
      />
      <button>My account</button>
      <button>Favorites</button>
      <button>Cart</button>
    </nav>
  );
};

export default Navbar;
